import{_ as i}from"./plugin-vue_export-helper.21dcd24c.js";import{o as l,c as t,d as a}from"./app.a3d402e1.js";const e={},r=a('<div class="custom-container tip"><p class="custom-container-title">\u524D\u8A00</p><p>\u8BB0\u5F55\u9879\u76EE\u7ECF\u7406\u7684\u89D2\u8272\u7AE0\u8282\u7684\u76F8\u5173\u77E5\u8BC6\u3001\u9891\u7E41\u8003\u70B9\u3002</p></div><h2 id="\u9879\u76EE\u7ECF\u7406" tabindex="-1"><a class="header-anchor" href="#\u9879\u76EE\u7ECF\u7406" aria-hidden="true">#</a> \u9879\u76EE\u7ECF\u7406</h2><p>\u9879\u76EE\u7ECF\u7406\u7531\u6267\u884C\u7EC4\u7EC7\u59D4\u6D3E, \u9886\u5BFC\u56E2\u961F\u5B9E\u73B0\u9879\u76EE\u76EE\u6807\u7684\u4E2A\u4EBA\u3002</p><p>\u9879\u76EE\u7ECF\u7406 =&gt; \u4E13\u6CE8\u9879\u76EE\u76EE\u6807\u5927\u8FBE\u6210\u3002</p><p>\u9879\u76EE\u7ECF\u7406\u65E0\u9700\u627F\u62C5\u9879\u76EE\u4E2D\u7684\u6BCF\u4E2A\u89D2\u8272, \u4F46\u5E94\u5177\u5907\u9879\u76EE\u7BA1\u7406\u77E5\u8BC6\u3001\u6280\u672F\u77E5\u8BC6\u3001\u7406\u89E3\u80FD\u529B\u548C\u76F8\u5173\u7ECF\u9A8C\u3002\u9879\u76EE\u7ECF\u7406\u901A\u8FC7\u6C9F\u901A\u9886\u5BFC\u9879\u76EE\u56E2\u961F\u8FDB\u884C\u89C4\u5212\u548C\u534F\u8C03\u3002</p><p>\u9879\u76EE\u7ECF\u7406\u7684\u5F71\u54CD\u8303\u56F4\uFF1A\u9879\u76EE\u3001\u7EC4\u7EC7\u3001\u884C\u4E1A\u3001\u4E13\u4E1A\u5B66\u79D1\u3001\u8DE8\u9886\u57DF</p><p>\u9879\u76EE\u76EE\u6807\u662F\u7531\u53D1\u8D77\u4EBA\u5236\u5B9A\u548C\u6700\u7EC8\u51B3\u5B9A\u7684\u3002\u9879\u76EE\u7ECF\u7406\u662F\u6765\u5E26\u9886\u56E2\u961F\u5B9E\u73B0\u8FD9\u4E2A\u76EE\u6807\u7684\u4E2A\u4EBA, \u4E0D\u80FD\u5BF9\u76EE\u6807\u6709\u51B3\u5B9A\u6743\u3002</p><h2 id="pmi-\u4EBA\u624D\u4E09\u89D2" tabindex="-1"><a class="header-anchor" href="#pmi-\u4EBA\u624D\u4E09\u89D2" aria-hidden="true">#</a> PMI \u4EBA\u624D\u4E09\u89D2</h2><ul><li>\u6280\u672F\u9879\u76EE\u7BA1\u7406\u6280\u80FD =&gt; \u6709\u6548\u8FD0\u7528\u9879\u76EE\u7BA1\u7406\u77E5\u8BC6\u5B9E\u73B0\u9879\u76EE\u96C6\u6216\u9879\u76EE\u7684\u9884\u671F\u6210\u679C\u7684\u80FD\u529B</li><li>\u6218\u7565\u548C\u5546\u52A1\u7BA1\u7406\u6280\u80FD =&gt; \u7EB5\u89C8\u7EC4\u7EC7\u6982\u51B5\u5E76\u6709\u6548\u534F\u5546\u548C\u6267\u884C\u6709\u5229\u4E8E\u6218\u7565\u8C03\u6574\u548C\u521B\u65B0\u7684\u51B3\u7B56\u548C\u884C\u52A8\u7684\u80FD\u529B</li><li>\u9886\u5BFC\u529B\u6280\u80FD =&gt; \u6307\u5BFC\u3001\u6FC0\u52B1\u548C\u5E26\u9886\u56E2\u961F\u7684\u80FD\u529B\uFF08\u534F\u5546\u3001\u6297\u538B\u3001\u6C9F\u901A\u3001\u89E3\u51B3\u95EE\u9898\u3001\u6279\u5224\u6027\u601D\u8003\u3001\u4EBA\u9645\u5173\u7CFB\u6280\u80FD\uFF09</li></ul><h2 id="\u9879\u76EE\u7ECF\u7406\u6743\u529B" tabindex="-1"><a class="header-anchor" href="#\u9879\u76EE\u7ECF\u7406\u6743\u529B" aria-hidden="true">#</a> \u9879\u76EE\u7ECF\u7406\u6743\u529B</h2><ul><li>\u5730\u4F4D =&gt; \u6709\u65F6\u79F0\u4E3A\u6B63\u5F0F\u7684\u3001\u6743\u5A01\u7684\u3001\u5408\u6CD5\u6743\u5229\u7684, \u4F8B\u5982\u7EC4\u7EC7\u6216\u56E2\u961F\u6388\u4E88\u7684\u6B63\u5F0F\u804C\u4F4D</li><li>\u4FE1\u606F =&gt; \u4F8B\u5982\u5BF9\u4FE1\u606F\u6536\u96C6\u6216\u5206\u53D1\u7684\u63A7\u5236</li><li>\u53C2\u8003 =&gt; \u4F8B\u5982\u56E0\u4E3A\u4ED6\u4EBA\u7684\u5C0A\u91CD\u548C\u8D5E\u8D4F, \u83B7\u5F97\u7684\u4FE1\u4EFB</li><li>\u60C5\u5883 =&gt; \u4F8B\u5982\u5728\u7279\u522B\u5371\u673A\u7B49\u7279\u6B8A\u60C5\u51B5\u4E0B\u83B7\u5F97\u7684\u6743\u5229</li><li>\u4E2A\u6027\u6216\u9B45\u529B =&gt; \u4F8B\u5982\u9B45\u529B\u3001\u5438\u5F15\u529B</li><li>\u5173\u7CFB =&gt; \u4F8B\u5982\u53C2\u4E0E\u4EBA\u4EBA\u9645\u4EA4\u9645\u3001\u8054\u7CFB\u548C\u7ED3\u76DF</li><li>\u4E13\u5BB6 =&gt; \u4F8B\u5982\u62E5\u6709\u7684\u6280\u80FD\u548C\u4FE1\u606F\u3001\u7ECF\u9A8C\u3001\u57F9\u8BAD\u3001\u6559\u80B2\u3001\u8BC1\u4E66</li><li>\u5956\u52B1\u76F8\u5173\u7684 =&gt; \u4F8B\u5982\u80FD\u591F\u7ED9\u4E88\u8868\u626C\u3001\u91D1\u94B1\u6216\u5176\u4ED6\u5956\u52B1</li><li>\u5904\u7F5A\u6216\u5F3A\u5236\u529B =&gt; \u4F8B\u5982\u7ED9\u4E88\u7EAA\u5F8B\u5904\u5206\u6216\u65BD\u52A0\u8D1F\u9762\u540E\u679C\u7684\u80FD\u529B</li><li>\u8FCE\u5408 =&gt; \u4F8B\u5982\u8FD0\u7528\u5949\u627F\u6216\u5176\u4ED6\u5E38\u7528\u624B\u6BB5\u8D62\u5F97\u9752\u7750\u6216\u5408\u4F5C</li><li>\u65BD\u52A0\u538B\u529B =&gt; \u4F8B\u5982\u9650\u5236\u9009\u62E9\u6216\u6D3B\u52A8\u81EA\u7531, \u4EE5\u7B26\u5408\u9884\u671F\u7684\u884C\u52A8</li><li>\u6127\u759A =&gt; \u4F8B\u5982\u5F3A\u52A0\u7684\u4E49\u52A1\u6216\u8D23\u4EFB\u611F</li><li>\u8BF4\u670D\u529B =&gt; \u4F8B\u5982\u80FD\u591F\u63D0\u4F9B\u8BBA\u636E, \u4F7F\u4ED6\u4EBA\u6267\u884C\u9884\u671F\u7684\u884C\u52A8\u65B9\u6848</li><li>\u56DE\u907F =&gt; \u4F8B\u5982\u62D2\u7EDD\u53C2\u4E0E</li></ul><p>\u9879\u76EE\u7ECF\u7406\u5904\u4E8E\u5F31\u77E9\u9635\u4E2D, \u4ED6\u5E94\u8BE5\u66F4\u52A0\u6CE8\u91CD\u4E13\u5BB6\u6743\u5229\u3001\u53C2\u8003\u6743\u5229\u3001\u9B45\u529B\u6743\u5229</p><p>\u5728\u654F\u6377\u9879\u76EE\u4E0A, \u9879\u76EE\u7ECF\u7406\u7684\u89D2\u8272\u662F\u6FC0\u52B1\u56E2\u961F\u7684\u9886\u5BFC\u8005\u3002</p><p>\u9879\u76EE\u6574\u5408\u7BA1\u7406\u662F\u9879\u76EE\u7ECF\u7406\u7EDD\u5BF9\u4E0D\u80FD\u6388\u6743\u51FA\u53BB\u7684\u5DE5\u4F5C\u3002</p><h2 id="\u9879\u76EE\u7ECF\u7406\u7684\u9886\u5BFC\u98CE\u683C" tabindex="-1"><a class="header-anchor" href="#\u9879\u76EE\u7ECF\u7406\u7684\u9886\u5BFC\u98CE\u683C" aria-hidden="true">#</a> \u9879\u76EE\u7ECF\u7406\u7684\u9886\u5BFC\u98CE\u683C</h2><ul><li>\u653E\u4EFB\u578B =&gt; \u6216\u79F0\u4E3A\u201C\u65E0\u4E3A\u800C\u6CBB\u201D,\u5141\u8BB8\u56E2\u961F\u81EA\u4E3B\u51B3\u7B56\u548C\u8BBE\u5B9A\u76EE\u6807\u3001\u9002\u5408\u521B\u65B0</li><li>\u4EA4\u6613\u578B =&gt; \u5173\u6CE8\u76EE\u6807\u3001\u53CD\u9988\u548C\u6210\u5C31\u4EE5\u786E\u5B9A\u5956\u52B1,\u4F8B\u5916\u7BA1\u7406</li><li>\u670D\u52A1\u578B =&gt; \u670D\u52A1\u4F18\u5148\u4E8E\u9886\u5BFC,\u5904\u5904\u5148\u4E3A\u4ED6\u4EBA\u7740\u60F3\uFF1B\u5173\u6CE8\u4ED6\u4EBA\u7684\u6210\u957F\u3001\u5B66\u4E60\u3001\u53D1\u5C55\u3001\u4EBA\u9645\u5173\u7CFB\u3001\u56E2\u961F\u4E0E\u5408\u4F5C</li><li>\u53D8\u9769\u578B =&gt; \u901A\u8FC7\u7406\u60F3\u5316\u7279\u8D28\u548C\u884C\u4E3A\u3001\u9F13\u821E\u6027\u6FC0\u52B1\u3001\u4FC3\u8FDB\u521B\u65B0\u548C\u521B\u9020\u3001\u4EE5\u53CA\u4E2A\u4EBA\u5173\u6000\u63D0\u9AD8\u8FFD\u968F\u8005\u80FD\u529B</li><li>\u9B45\u529B\u578B =&gt; \u7CBE\u795E\u9971\u6EE1\u3001\u70ED\u60C5\u6D0B\u6EA2\u3001\u5145\u6EE1\u81EA\u4FE1\u3001\u8BF4\u670D\u529B\u5F3A\u3001\u80FD\u591F\u6FC0\u52B1\u4ED6\u4EBA</li><li>\u4EA4\u4E92\u578B =&gt; \u7ED3\u5408\u4E86\u4EA4\u6613\u578B\u3001\u53D8\u9769\u578B\u548C\u9B45\u529B\u578B\u7684\u7279\u70B9</li></ul><p>\u5728\u9879\u76EE\u89C4\u5212\u65E9\u671F\u548C\u6536\u5C3E\u9636\u6BB5, \u72EC\u88C1\u5F0F\u7BA1\u7406\u98CE\u683C\u66F4\u52A0\u9002\u7528\u3002</p>',17),c=[r];function p(d,n){return l(),t("div",null,c)}var s=i(e,[["render",p],["__file","project-manager.html.vue"]]);export{s as default};
